import React from 'react';

function Quiz() {
    const questions = [
        {
            question: 'What is the capital of France?',
            options: ['Berlin', 'Madrid', 'Paris', 'Lisbon'],
        },
        {
            question: 'What is 2 + 2?',
            options: ['3', '4', '5', '6'],
        }
    ];

    // Your component logic and return statement
}

export default Quiz;
